import React from "react";
import { useParams, useNavigate } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";
import useStore from "../store/useStore";
import BlogCard from "./BlogCard";
import Services from "./Services";
import bannerImg from "../assets/blog-banner.png"; // ✅ import a different banner image

export default function BlogDetail() {
  const { id } = useParams();
  const navigate = useNavigate();
  const blogs = useStore((state) => state.blogs);

  const blog = blogs.find((b) => String(b.id) === id);

  if (!blog) {
    return (
      <Container style={{ padding: "60px 20px", textAlign: "center" }}>
        <h2>Blog not found</h2>
        <button
          onClick={() => navigate("/blog")}
          style={{
            marginTop: "20px",
            padding: "10px 20px",
            background: "#246A21",
            border: "none",
            borderRadius: "6px",
            color: "#fff",
            cursor: "pointer",
          }}
        >
          Back to Blogs
        </button>
      </Container>
    );
  }

  // Pick 3 related blogs (excluding the current one)
  const related = blogs.filter((b) => b.id !== blog.id).slice(0, 3);

  return (
    <>
      <section style={{ padding: "40px 0" }}>
        <Container>
          {/* ✅ Banner Image */}
          <div
            style={{
              height: "749.439px",
              alignSelf: "stretch",
              borderRadius: "10px",
              background: `url(${bannerImg}) lightgray 50% / cover no-repeat, #D9D9D9`,
              marginBottom: "40px",
            }}
          />

          {/* ✅ Main Blog Title */}
          <h1
            style={{
              alignSelf: "stretch",
              color: "#222",
              fontFamily: "Raleway",
              fontSize: "46.84px",
              fontStyle: "normal",
              fontWeight: 700,
              lineHeight: "140%", // 65.576px
              textTransform: "capitalize",
              marginBottom: "20px",
            }}
          >
            {blog.title}
          </h1>

          {/* ✅ Subtitle / Intro */}
          <p
            style={{
              height: "161.338px",
              alignSelf: "stretch",
              color: "#666",
              fontFamily: "Raleway",
              fontSize: "26.022px",
              fontStyle: "normal",
              fontWeight: 400,
              lineHeight: "150%", // 39.033px
              marginBottom: "40px",
            }}
          >
            {blog.excerpt ||
              "Are you here for something specific or just to explore? Here’s a quick insight..."}
          </p>

          {/* ✅ Secondary Heading */}
          <h2
            style={{
              alignSelf: "stretch",
              color: "#333",
              fontFamily: "Raleway",
              fontSize: "36.431px",
              fontStyle: "normal",
              fontWeight: 600,
              lineHeight: "140%", // 51.004px
              textTransform: "capitalize",
              marginBottom: "20px",
            }}
          >
            {blog.subtitle || "I Produced A Unique Developer Rap Video"}
          </h2>

          {/* ✅ Full Blog Content */}
          <p
            style={{
              width: "1432.956px",
              color: "#666",
              fontFamily: "Raleway",
              fontSize: "26.022px",
              fontStyle: "normal",
              fontWeight: 400,
              lineHeight: "150%", // 39.033px
              marginBottom: "40px",
            }}
          >
            {blog.content ||
              "Full blog content goes here. Expand this section with real details from the database or CMS."}
          </p>

          {/* ✅ Related Blogs */}
          {related.length > 0 && (
            <div style={{ marginTop: "60px" }}>
              <h3
                style={{
                  width: "346.531px",
                  flexShrink: 0,
                  color: "#333",
                  fontFamily: "Raleway",
                  fontSize: "46.204px",
                  fontStyle: "normal",
                  fontWeight: 700,
                  lineHeight: "140%", // 64.686px
                  textTransform: "capitalize",
                  marginBottom: "20px",
                }}
              >
                Related Blog
              </h3>
              <Row xs={1} sm={2} md={3} className="g-4">
                {related.map((b) => (
                  <Col key={b.id}>
                    <div
                      style={{ cursor: "pointer" }}
                      onClick={() => navigate(`/blog/${b.id}`)}
                    >
                      <BlogCard blog={b} />
                    </div>
                  </Col>
                ))}
              </Row>
            </div>
          )}
        </Container>
      </section>

      {/* ✅ Services Section */}
      <div style={{ marginTop: "80px", width: "100%" }}>
        <Services />
      </div>
    </>
  );
}
